        return (

            <div  className="headerImage">


            {/* <img  src="http://i0.wp.com/cdn-images-1.medium.com/max/1600/1*5DAQEDPv_5opTqr-y6yEag.gif"/> */}
                <div className="content">

                    <h1 className="text-center mt-4 text-white"> Clicky Game</h1>


